    [],nt"num_tags": 4,nt"name": "refuge-narrative-report-september-december-1960-kenai-national-moose-range",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kenai National
    Moose Range outlines Refuge accomplishments from September through December of 1960.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, raptors, and
    fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, collections and receipts, and vegetation control. Resource
    management is outlined; topics include fur harvesting and timber removal. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, and violations. Items of interest, N-R forms, and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
